import React from "react";

function Coin({ name, icon, price, symbol, marketCap, priceChange }) {
  return (
    <div className="crypto-item">
      <h2>{name}</h2>
      <img className="crypto-image" src={icon} alt={`${name} icon`} />
      <p>Price: ${price}</p>
      <p>Symbol: {symbol}</p>
      <p>Market Cap: ${marketCap.toLocaleString()}</p>
      <p>Price Change: ${priceChange.toFixed(2)}</p>
    </div>
  );
}

export default Coin;
